import Logo from "../../assets/img.png";
import { ThemeDiv, ThemeHeader } from "./style";
const HeaderHome = () => {
  return (
    <ThemeHeader w="100%" bc="cyan" j="space-between">
      <img src={Logo} alt="Logo" />
      <ThemeDiv f="row" w="300px" a="center" g="">
        <ThemeDiv>
          <button>Home</button>

          <button>Login</button>

          <button>Cadastrar escola</button>

          <button>Eventos</button>
        </ThemeDiv>
      </ThemeDiv>
    </ThemeHeader>
  );
};

export default HeaderHome;
